import L from 'leaflet';

const iconTractor = L.Icon({
    iconUrl: require('../../images/tractor.png'),
    iconRetinaUrl: require('../../images/tractor.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
    className: 'leaflet-div-icon'
});

export { iconTractor };
